import { Component } from "react";

import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      firstName: "Yu-An",
      lastName: "Chen",
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Hey {this.state.firstName} {this.state.lastName}
          </p>
          <button
            onClick={() => {
              this.setState(
                () => {
                  return {
                    firstName: "James",
                    lastName: "Fungi",
                  };
                },
                () => {}
              );
            }}
          >
            Change name
          </button>
        </header>
      </div>
    );
  }
}

export default App;
